class Button:    def __init__(self):        self.type: str = ""  # "url_button", "photo_button", "video_button"        self.name: str = ""        self.text: str = ""        self.url: str = ""        self.photo = None        self.video = Noneclass nsql_database:    def __init__(self) -> None:        self.data = {}    # Получение значения по ключу    def get_elem(self, key: int | str) -> Button | bool:        if key in self.data:            return self.data[key]        else:            return Falseclass Keyboard(nsql_database):    def __init__(self):        super().__init__()    def add_but(self, button: Button):        self.data[button.name] = button    def __contains__(self, other) -> bool:        if other in self.data:            return True        else:            return False